Template.confirmPasswordAppAffId.onRendered(function() {
    $('#application-confirmPasswordAppAffId').validate({
        onkeyup: false,
        rules: {
            oldPassword: {
                required: true,
                minlength: 6,
            },
            affIdCon: {
                required: true,
                maxlength: 3,
                checkSpaceP_A: true,
                checkAffIdDup:true
            }
        },
        // Display only one error at a time
        showErrors: function(errorMap, errorList) {
            $("#application-confirmPasswordAppAffId").find("input").each(function() {
                $(this).removeClass("error");
            });
            if (errorList.length) {
                $("#changePasswordError").html("<span class='glyphicon glyphicon-remove-sign red'></span> " + errorList[0]['message']);
                $(errorList[0]['element']).addClass("error");
            }
        },
        messages: {
            oldPassword: {
                required: "Please enter  your password ",
                minlength: "Please enter a valid  password.",
            },
            affIdCon: {
                required: "Please enter 3 characters for affId.",
                maxlength: "Only 3 characters are allowed for affId.",
                checkSpaceP_A: "Characters for affId. is not valid",
                checkAffIdDup:"Please use different District Code"
            }
        },
        submitHandler: function() {
            $("#changePasswordError").html("");
            var digest = Package.sha.SHA256($('#oldPassword').val());
            try {
                Meteor.call('checkPassword', digest, function(err, result) {
                    try {
                        if (result.error == null) {
                            $("#confirmPasswordAppAffId").modal('hide');
                            var affIdFormat = "";
                            if($("#affIdCon").val())
                             	affIdFormat = $("#affIdCon").val();
                            Meteor.call("generateAffId", affIdFormat, Session.get("geneAffIdSess"), function(e, res) {
                                if (res) {
                                    try {
                                    	approvalCounter++;
										
										setCounterOnApproval();

                                      
                                    } catch (e) {
                                    }
                                } else if(res != undefined && res != null && res == false){
                                	$("#changePasswordError").html("<span class='glyphicon glyphicon-remove-sign red'></span> " +"user different code")
                                }	
                            })
                        } else {
                            $("#changePasswordError").html("<span class='glyphicon glyphicon-remove-sign red'></span> " + result.error.reason);
                        }
                    } catch (e) {}
                });
            } catch (e) {
            }
        }
    });
});

